import { HttpClient } from '@angular/common/http';
import { Component, Inject } from '@angular/core';

@Component({
  selector: 'app-menu',
  templateUrl: './menu.component.html',
  styleUrls: ['./menu.component.css']
})
export class MenuComponent {

  constructor(http: HttpClient, @Inject('BASE_URL') baseUrl: string) {
    http.get<string>(baseUrl + 'report').subscribe(result => {
      console.log(result);
    }, error => console.error(error));
  }

}



<div class="btns-container"> 
    <div class="btns-inner-container">
        <button type="button" class="btn btn-primary btn-lg" [routerLink]="['/form']">Добавить инцидент</button>
        <button type="button" class="btn btn-secondary btn-lg">Выгрузить отчет</button>
    </div>
</div>
